import React from 'react';
import { Component } from 'react';
import '../css/Home.css';
import Header from './Header.js';

export default class Home extends Component {
    constructor() {
      super();
    }

    render() {
        return(
            <div>
            <Header/>
            <div className="Home">
                <h3>Hello</h3>
            </div>
            </div>
        );
    }
}
